window.bookSummaryJSON = "<p><b>Q:</b> What has two eyes (usually), a practice sword, and no clue?</p> <p><b>A:</b> A noob. And a horde of them are coming to ruin Devon's day.</p> <p>Freshly returned from the underworld, Devon Walker has a major task ahead. A demon army is coming, and she must prepare Stonehaven for war. But no amount of fortification will allow the small settlement to hold against the coming horde. For Devon's followers to survive, she must retrieve the final relic of Ishildar and wake the ancient city's power.</p> <p>Too bad about all the noobs getting in the way.</p> <p><i>Vault of the Magi</i>, the fifth book in the Stonehaven League series continues the epic saga. Scroll and buy now to keep listening! </p> <p>The Soundbooth Theater team for this production:</p> <p></p> <ul> <li>Annie Ellicott - narration</li> <li>Jeff Hays - Emerson, Owen, and the rest of the male cast</li> <li>Bonnie Price - proofing</li> <li>Nicholas Shoup - editing and mastering</li> <li>Ahmed Mahmoud - sound design and music</li> </ul>"; 
